CREATE TABLE IF NOT EXISTS `agents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL,
  `password` varchar(100) DEFAULT NULL,
  `name` varchar(100) NOT NULL COMMENT 'agent\\''s name',
  `email` varchar(100) NOT NULL COMMENT 'email to the agent',
  `phone` varchar(45) DEFAULT NULL COMMENT 'telephone number to the agent',
