CREATE TABLE IF NOT EXISTS `invoices` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `total` float NOT NULL,
  `booking_amount` float DEFAULT NULL,
  `issue_date` date NOT NULL,
  `due_date` date NOT NULL,
  `customer_id` int(11) NOT NULL,
  `billing_contact` int(11) NOT NULL COMMENT 'contact_id for the billing section in the invoice',
  `delivery_contact` int(11) DEFAULT NULL COMMENT 'contact_id for the delivery of the product\\n',
  `note` text,
  `invoice_pdf` mediumblob,
  PRIMARY KEY (`id`),
  KEY `fk_invoices_customers1_idx` (`customer_id`),
  KEY `fk_invoices_contacts1_idx` (`billing_contact`),
  KEY `fk_invoices_contacts2_idx` (`delivery_contact`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=3 ;

