CREATE TABLE IF NOT EXISTS `logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` int(11) DEFAULT '200',
  `message` varchar(500) COLLATE utf8_czech_ci DEFAULT NULL,
  `action` varchar(50) COLLATE utf8_czech_ci DEFAULT NULL,
  `object_type` varchar(45) COLLATE utf8_czech_ci DEFAULT NULL COMMENT 'reference to the object that was the target of the log entry (if any)',
  `object_id` int(11) DEFAULT NULL COMMENT 'reference to the object that was the target of the log entry (if any)',
  `log_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_czech_ci AUTO_INCREMENT=2 ;

